<script setup lang="ts">
import Navbar from './Navbar.vue';
import { ref, onMounted } from "vue";
import { useRoute, useRouter } from "vue-router";
import { MoviesController } from "../shared/MoviesController";
import type { Movie } from "../shared/movie";
import { fetchUser, user, signedIn, signOut, googleUser } from '../auth'

const route = useRoute();
const movie = ref<Movie | null>(null);

const router = useRouter()

function goToReview(movieId: number) {
  if (!signedIn.value) {
    router.push("/signin")
    return
  }
  router.push(`/movies/${movieId}/review`)
}

onMounted(async () => {
  const id = Number(route.params.id);
  if (!isNaN(id)) {
    movie.value = await MoviesController.getMovieById(id);
    await MoviesController.calculatePopularityForAllMovies();
  }
  
  if(user.name) fetchUser()
});

</script>

